import react from 'react';

// Dummy component
const MyNav = props => {
	return (
		<ul style={styles.myNav}>
			<li>
				<a href="" style={styles.navLinks}>
					News Feed
				</a>
			</li>
			<li>
				<a href="">Messages</a>
			</li>
			<li>
				<a href="">Watch</a>
			</li>
		</ul>
	);
};

// Export
export default MyNav;

// Styling
const styles = {
	myNav: {
		listStyle: 'none',
		padding: 0,
		margin: '20px',
	},
	navLinks: {
		backgroundColor: 'lightGrey',
		padding: '20px',
		color: '#000',
		textDecoration: 'none',
	},
};
